function App() {
  const state = useSelector(state => state.users.users);
  const dispatch = useDispatch();

  let obj = {
    ff: 'yeee',
    gg: 'fff',
    tt: 'sdfds',
  }

  const f = () => {
    return {
      ...obj
    }
  }

  console.log(f())
  return (
    <div className="App">
      {state.map(item => {
        return (<div>
          {item.title}
        </div>)
      })}
    </div>
  );
}

export default App;
